import React, { Component } from 'react'
import {
  ScrollView,
  Text
} from 'react-native'
import AddReviewView from '../components/AddReviewView'

export default class AddReviewScreen extends Component {
  render () {
    return (
      <ScrollView>
        <AddReviewView/>
        <Text>testing</Text>
      </ScrollView>
    )
  }
}
